सहकारी ठगी प्रकरणमा पर्सा जिल्ला अदालतले राष्ट्रिय स्वतन्त्र पार्टी (रास्वपा)का सभापति रवि लामिछानेसँग एक करोड रूपैयाँ धरौटी मागेको छ ।&amp;nbsp;

मंगलबार भएको थुनछेक बहसपछि लामिछानेसँग १ करोड रूपैयाँ धरौटी माग्ने आदेश भएको हो ।&amp;nbsp;

पर्सा जिल्

राष्ट्रिय मुक्ति पार्टी नेपालका अध्यक्ष राजेन्द्र महतोले सर्लाही-२ बाट प्रतिनिधिसभा सदस्यको उम्मेदवारी मनोनयन दर्ता गराएका छन् ।&amp;nbsp;

उनले मंगलबार दिउँसो निर्वाचन अधिकृतको कार्यालय पुगेर उम्मेदवारी दर्ता गराएका हुन् ।&amp;nbsp;

उनी २०७९ सालको

आम जनता पार्टी (आजपा)का अध्यक्ष प्रभु साहले रौतहट&amp;ndash;३ बाट उम्मेदवारी मनोनयन दर्ता गरेका छन् ।&amp;nbsp;

साहले आफैं नभएर प्रतिनिधिमार्फत् उम्मेदवारी मनोनयन गराएका हुन् ।&amp;nbsp;

साह पटक-पटक रौतहट&amp;ndash;३ बाट निर्वाचित हुँदै आएका छन् ।

नेपाली कांग्रेसले सुर्खेत क्षेत्र नम्बर १ मा विष्णुबहादुर खड्कालाई टिकट दिएको छ ।&amp;nbsp;

उनी कांग्रेसका पूर्व कार्यवाहक सभापति पूर्णबहादुर खड्काका सहोदर भाइ हुन् ।&amp;nbsp;

पूर्णले आफू स्वयं समेतले सर्वोच्च अदालतमा मुद्दा दर्ता गरेको र अवैधानिक

काठमाडौँ । सञ्चार तथा सूचना प्रविधिमन्त्री जगदिश खरेलले पदबाट राजीनामा दिएका छन् ।

ललितपुर-२ बाट प्रतिनिधिसभा सभा निर्वाचन लड्ने निश्चित भएपछि खरेलले प्रधानमन्त्री सुशीला कार्कीलाई राजीनामा पत्र बुझाएका हुन् ।&amp;nbsp;

